import {Link} from 'react-router-dom';

export const NavBar = () => {
  return (
    <div className='navbar'>
      <div><h1>Coupon Web</h1></div>
      <div>
        <Link to='/getAllCompanys'><h3>Get All Companies</h3></Link>
        <Link to='/UpdateCompany'><h3>Update Company</h3></Link>
        <Link to='/DeleteCompany'><h3>Delete Company</h3></Link>
        <Link to='/GetOneCompany'><h3>Get One Company</h3></Link>
      </div>
    </div>
  )
}
